 , p -

<div class="entities" style="line-height: 2.5; direction: ltr">Activation of c-fos by lipopolysaccharide in glial cells via p38 mitogen-activated protein kinase-dependent activation of serum or cyclic AMP / calcium response element . Pathological conditions such as ischaemic stroke and inflammatory disorders cause c-fos activation in the brain . This activation contributes to the initiation of the brain ' s inflammatory response , orchestrated by activated glial cells . The inflammatory signalling cascades leading to c-fos activation in glial cells are not well characterized . Thus , we have attempted a detailed analysis of the cis-acting elements , transcription factors and upstream kinase pathways involved in the activation of c-fos by lipopolysaccharide ( LPS ) in primary rat cortical glial cells . We found that ( 1 ) LPS-induced c-fos mRNA levels were sensitive to p38 mitogen-activated protein kinase ( MAPK ) inhibitors but not to mitogen-activated / extracellular signal-regulated kinase ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 ) or calcium-calmodulin-dependent kinase inhibitors , ( 2 ) LPS activated both serum response element ( SRE ) and cyclic AMP / calcium response element ( CRE ) - driven luciferase reporters in transient transfection assays , ( 3 ) LPS induced the phosphorylation of Elk 1 CRE-binding protein ( CREB ) / activated transcription factor - 1 (

 - 1 ) and the activation of GAL 4 - Elk 1 and GAL 4 - CREB chimeric proteins , and ( 4 ) mutation of both SRE and CRE elements was necessary and sufficient to completely abolish LPS induction of a rat c-fos proximal promoter-luciferase reporter . Thus , c-fos activation by LPS in glial cells occurs via the SRE or CRE in an independent manner , and involves the Elk 1 or CREB / 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

<div class="entities" style="line-height: 2.5; direction: ltr">P62158 - mediated effects of loperamide on chloride transport by brush border membrane vesicles from human ileum . We investigated whether the synthetic opiate loperamide-HCl is able to regulate specific transport systems for sodium and chloride in brush border membrane vesicles ( BBMVs ) from human ileum and whether such activities are mediated by calcium / calmodulin . In BBMVs we studied Na + / H + antiport , Cl + / OH - antiport , Na + / Cl - cotransport , and the Cl - conductive pathway . Brush border membrane vesicles were incubated with 10 microM loperamide over 4 h at 5 degrees C before the uptake experiments . In ileal BBMVs , loperamide stimulated intravesicular accumulation of Na + in the presence of Cl - and vice versa . After 1 min of incubation , the stimulatory effect was 35 % + / - 5 % ( p less than 0.005 ) of the control without loperamide . 
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

</mark>
 also stimulated Cl - / OH - antiport by 30 % + / - 5 % ( p less than 0.005 ) in BBMVs of ileum . In addition , we studied the role of Ca2 + / calmodulin in the action of loperamide on chloride transport by human BBMVs . In loperamide-pretreated BBMVs , calmodulin activity was significantly decreased ( 12 + / - 2 vs . 38 + / - 4 pmol / mg protein ) . When loperamide-pretreated vesicles were incubated with 2 microM calcium ( free concentration ) plus 5 microM calmodulin for 1 h at 5 degrees C , complete inhibition of the stimulatory effect of loperamide on Cl - / OH - antiport and Na + / Cl - cotransport was observed . Increasing the Ca2 + / calmodulin activity of loperamide-pretreated BBMVs with 2 microM calcium plus 5 microM calmodulin led to a significant inhibition of Cl - / OH - antiport and Na + / Cl - cotransport by 40 % + / - 5 % ( p less than 0.005 ) .</div>

<h2 style="margin: 0">9</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">
<mark class="entity" style="background: linear-gradient(90deg, #CC9966, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    DB01628
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">MEN</span>
</mark>
 - induced fixed drug eruption with positive lesional patch tests . Fixed drug eruption ( FDE ) is most commonly associated with antibiotics , anticonvulsants , and nonnarcotic analgens , including nonsteroidal anti-inflammatory drugs ( NSAIDs ) . However , the newer cyclooxygenase 2 ( 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">
    P35354
    <span style="font-size: 0.8em; font-weight: bold; line-height: 1; border-radius: 0.35em; text-transform: uppercase; vertical-align: middle; margin-left: 0.5rem">REA</span>
</mark>
 ) inhibitors have been rarely reported to cause FDE . We report the case of a 52 - year-old Caucasian woman with erythematous pruritic plaques on the neck , left forearm , and second finger of the right hand , healing with hyperpigmentation and recurring in the same locations . The patient was sporadically taking oral etoricoxib 90 mg for her back pain and noticed the relation between administration of the drug and skin lesions , the time interval decreasing progressively from 1 week to 30 minutes . No other signs , symptoms , or drug intake was mentioned . The patch tests with etoricoxib 1 % and 5 % in petrolatum were positive at the location of the lesions and negative on the back ( nonlesional skin ) . Standard European and NSAID series were negative . Patch tests of 10 healthy controls with etoricoxib 1 % and 5 % in petrolatum were negative . After the avoidance of the drug , no relapse was mentioned . The patch test was reliable for the diagnosis of FDE , avoiding the need for subsequent oral provocation testing and therefore preventing the possible adverse effects . Despite being regarded as a safe drug , the occurrence of cutaneous adverse reactions to etoricoxib should be considered , especially in the setting of its increasing use in pain control .</div>

<div class="entities" style="line-height: 2.5; direction: ltr">Activity , pharmacological inhibition and biological regulation of 3 - hydroxy - 3 - methylglutaryl coenzyme A reductase in Trypanosoma brucei . Activity of hydroxymethylglutaryl-coenzyme A ( HMG - DB01992 ) reductase , the key enzyme in the biosynthesis of steroids and polyisoprenoids in mammalian cells , has been detected in both the bloodstream form and the culture-adapted procyclic form of Trypanosoma brucei ( 3.7 + / - 0.6 and 12.7 + / - 1.8 pmol mevalonate produced min - 1 ( mg cell protein ) - 1 , respectively ) . The enzyme activity is enriched 6 - fold in microsomal fractions . Several competitive inhibitors of mammalian 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 activity is decreased 2 - fold in procyclics incubated with 4 mM mevalonate and increased 2 - fold in the presence of 2.5 microM synvinolin .
